import React from 'react';

type RevenueVsBaselineChartProps = {
  agentRewards: number[];
  baselineRewards: number[];
};

const RevenueVsBaselineChart: React.FC<RevenueVsBaselineChartProps> = ({
  agentRewards = [],
  baselineRewards = []
}) => {
  const labels = Array.from({ length: Math.max(agentRewards.length, baselineRewards.length) }, (_, i) => `Episode ${i + 1}`);

  const cumulativeAgentRewards = agentRewards.reduce((acc, val, idx) => {
    const prev = idx > 0 ? acc[idx - 1] : 0;
    acc.push(prev + val);
    return acc;
  }, [] as number[]);

  const cumulativeBaselineRewards = baselineRewards.reduce((acc, val, idx) => {
    const prev = idx > 0 ? acc[idx - 1] : 0;
    acc.push(prev + val);
    return acc;
  }, [] as number[]);

  let improvementPercentage = 0;
  if (baselineRewards.length > 0 && agentRewards.length > 0) {
    const totalBaseline = baselineRewards.reduce((sum, val) => sum + val, 0);
    const totalAgent = agentRewards.reduce((sum, val) => sum + val, 0);

    if (totalBaseline > 0) {
      improvementPercentage = ((totalAgent - totalBaseline) / Math.abs(totalBaseline)) * 100;
    }
  }

  if (agentRewards.length === 0 && baselineRewards.length === 0) {
    return (
      <div className="flex items-center justify-center h-full bg-gray-50 rounded-lg">
        <div className="text-center p-6">
          <svg className="mx-auto h-12 w-12 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"
            />
          </svg>
          <h3 className="mt-2 text-sm font-medium text-gray-900">No training data available</h3>
          <p className="mt-1 text-sm text-gray-500">Start training to see revenue comparison.</p>
        </div>
      </div>
    );
  }

  const maxValue = Math.max(...cumulativeAgentRewards, ...cumulativeBaselineRewards);

  return (
    <div className="h-full relative overflow-hidden">
      <div className="absolute inset-0 bg-gradient-to-r from-blue-50 to-teal-50 opacity-50 rounded-lg"></div>
      <div className="relative h-full flex flex-col">
        <div className="flex justify-between items-center px-4 py-2">
          <div className="flex flex-wrap gap-4">
            <div className="flex items-center">
              <div className="w-3 h-3 rounded-full mr-1 bg-[rgba(75,192,192,1)]"></div>
              <span className="text-xs font-medium">AI Agent</span>
            </div>
            <div className="flex items-center">
              <div className="w-3 h-3 rounded-full mr-1 bg-[rgba(255,99,132,1)]"></div>
              <span className="text-xs font-medium">Human Baseline</span>
            </div>
            <div className="text-xs font-medium text-gray-700">
              Improvement: <span className={improvementPercentage >= 0 ? "text-green-600" : "text-red-600"}>
                {improvementPercentage.toFixed(2)}%
              </span>
            </div>
          </div>
        </div>

        <div className="flex-1 p-4">
          <div className="h-full flex items-end relative">
            {/* Y-axis labels */}
            <div className="absolute left-0 top-0 h-full flex flex-col justify-between">
              {Array.from({ length: 5 }).map((_, i) => {
                const value = maxValue * (1 - i / 4);
                return (
                  <div key={i} className="flex items-center">
                    <span className="text-xs text-gray-500 mr-1">${value.toFixed(0)}</span>
                    <div className="w-full border-t border-gray-200 absolute left-0" style={{ top: `${(i / 4) * 100}%` }}></div>
                  </div>
                );
              })}
            </div>

            {/* Chart bars */}
            <div className="w-full h-full pl-10 flex items-end">
              {cumulativeAgentRewards.map((value, index) => {
                const height = maxValue > 0 ? (value / maxValue) * 100 : 0;
                const baselineValue = cumulativeBaselineRewards[index] || 0;
                const baselineHeight = maxValue > 0 ? (baselineValue / maxValue) * 100 : 0;

                return (
                  <div key={index} className="flex-1 flex flex-col items-center justify-end h-full">
                    <div className="relative w-full flex justify-center">
                      {/* AI Agent bar */}
                      <div
                        className="w-1 bg-[rgba(75,192,192,1)] rounded-t transition-all duration-500 ease-out"
                        style={{
                          height: `${height}%`,
                          transform: 'scaleY(1)',
                          transformOrigin: 'bottom',
                          animation: `growUp 1s ease-out ${index * 0.05}s forwards`,
                        }}
                      ></div>

                      {/* Baseline bar */}
                      <div
                        className="w-1 bg-[rgba(255,99,132,1)] rounded-t transition-all duration-500 ease-out ml-1"
                        style={{
                          height: `${baselineHeight}%`,
                          transform: 'scaleY(1)',
                          transformOrigin: 'bottom',
                          animation: `growUp 1s ease-out ${index * 0.05}s forwards`,
                        }}
                      ></div>
                    </div>

                    {index % Math.ceil(labels.length / 10) === 0 && (
                      <div className="text-xs text-gray-500 mt-1 truncate w-full text-center">
                        {labels[index]}
                      </div>
                    )}
                  </div>
                );
              })}
            </div>
          </div>
        </div>
      </div>

      {/* CRA-safe style block for animation */}
      <style
        dangerouslySetInnerHTML={{
          __html: `
            @keyframes growUp {
              from { transform: scaleY(0); }
              to { transform: scaleY(1); }
            }
          `
        }}
      />
    </div>
  );
};

export default RevenueVsBaselineChart;
